import React from "react";
function Navbar() {
  return (
    <>
      <div
        style={{
          display: "flex",
          height: "90px",
          gap: "36px",
          paddingTop: "24px",
          paddingLeft: "16px",
          justifyContent: "space-between",
        }}
      >
        <div style={{ display: "flex", height: "90px" }}>
          <div>
            <ul
              style={{
                font: "Montserrat",
                fontSize: "16px",
                fontWeight: "500",
                color: "#333333",
                display: "flex",
                gap: "36px",
                listStyleType: "none",
              }}
            >
              <li>
Home
              </li>
              <li>About Me</li>
              <li>Services</li>
              <li>Portfolio</li>
              <li>Contact</li>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
}

export default Navbar;
